    const {img, title, txt} = props;
  return (
    <div className='img-descript-small'>
        <Container>
            <Row>
                <Col md={2}>
                    <img src={img} alt='' className='img-descript-small-logo'></img>
                </Col>
                <Col md={10}>
                    <h1 className='img-descript-small-txt'>asdfasf</h1>
                </Col>
            </Row>
        </Container>
    </div>
  )
}
